import styled from "styled-components";
import { Colors, TextStyles } from "../../Theme";

const HeaderEl = styled.header`
  padding: 1rem 0;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const LeftPart = styled.span`
  display: flex;
  column-gap: 1rem;
`;

const RightPart = styled.span`
  display: flex;
  column-gap: 1rem;
`;


const NavBar = styled.nav`
  display: flex;
  column-gap: 1rem;
  align-items: center;
  color: ${Colors.Brand.Button};
  ${TextStyles.Bundler(TextStyles.S1)}
`;
const NavItem = styled.a`
  :visited {
    color: ${Colors.Brand.Button};
  }
`;

export default function Header() {
  return (
    <HeaderEl>
      <LeftPart>
        <NavBar>
          <NavItem href="#">Edukacja</NavItem>
          <NavItem href="#">Kategorie</NavItem>
          <NavItem href="#">Stwórz</NavItem>
        </NavBar>
      </LeftPart>
      <RightPart>
        <NavBar>
          <NavItem href="#">Zaloguj się</NavItem>
        </NavBar>
      </RightPart>
    </HeaderEl>
  );
}
